/********************************************************************
* FUNCTION o_ran_transceiver_port_transceivers_port_transceiver_data_edit
*
* Edit database object callback
* Path: /port-transceivers/port-transceiver-data
* Add object instrumentation in COMMIT phase.
*
* INPUTS:
*     see agt/agt_cb.h for details
*
* RETURNS:
*     error status
********************************************************************/
static status_t o_ran_transceiver_port_transceivers_port_transceiver_data_edit (
    ses_cb_t *scb,
    rpc_msg_t *msg,
    agt_cbtyp_t cbtyp,
    op_editop_t editop,
    val_value_t *newval,
    val_value_t *curval)
{
    status_t res = NO_ERR;
    val_value_t *errorval = (curval) ? curval : newval;
    uint32 cur_errs = agt_get_error_count(msg);

    /* local key o-ran-transceiver:interface-name */
    const xmlChar *k_port_transceivers_port_transceiver_data_interface_name =
        VAL_STRING(sil_sa_get_key(msg, 1));

    /* local key o-ran-transceiver:port-number */
    const xmlChar *k_port_transceivers_port_transceiver_data_port_number =
        VAL_STRING(sil_sa_get_key(msg, 2));

    if (LOGDEBUG) {
        log_debug("\nEnter o_ran_transceiver_port_transceivers_port_transceiver_data_edit callback for %s phase",
            agt_cbtype_name(cbtyp));
    }

    res = u_o_ran_transceiver_port_transceivers_port_transceiver_data_edit(scb, msg, cbtyp, editop, newval, curval,
        k_port_transceivers_port_transceiver_data_interface_name,
        k_port_transceivers_port_transceiver_data_port_number);

    if ((res != NO_ERR) && (cur_errs == agt_get_error_count(msg))) {
        agt_record_error(
            scb,
            &msg->mhdr,
            NCX_LAYER_CONTENT,
            res,
            NULL,
            (errorval) ? NCX_NT_VAL : NCX_NT_NONE,
            errorval,
            (errorval) ? NCX_NT_VAL : NCX_NT_NONE,
            errorval);
    }
    return res;

} /* o_ran_transceiver_port_transceivers_port_transceiver_data_edit */


